@noobeginner True. Also, especially when you look at it in the grand scheme of things, none of it matters, even when you remove the hypocrisy from the subject at hand, these fools are getting flustered and complaining about social constructs that are considered taboo in real life, and applying them to literal drawn images about fictional characters and situations... That is straight-up idiotic and very delusional when you think about it.

Same applies to the annoying senators that want to ban Loli/Shota doujins and hentai claiming that it is "child pornography", while ironically talking about a drawn fictional medium that literally doesn't involve nor harm ANY real children... But it is whatever...


Anyway, if either you read doujins for the plot, the pornography or even for the sheer amusement once in a while, I wish you a wonderful day random fellow man of culture, and I hope for everyone to stay safe in these tough times while enjoying their off-brand goods. Cheers :)
